          "text": "<p class=\"MsoNoSpacing\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\">В\n60-70-е годы прошлого века в нашей стране и за рубежом начались работы по\nсозданию систем противовоздушной обороны на новых физических принципах,\nспособных сжечь воздушную цель с помощью высокоэнергетического лазерного луча.<o:p></o:p></span></p>\n\n<p class=\"MsoNoSpacing\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-bidi-font-weight:bold\">В 1964 году советским ученым А. Прохорову и <o:p></o:p></span></p>\n\n<p class=\"MsoNoSpacing\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-bidi-font-weight:bold\">Н. Басову была присуждена Нобелевская премия по\nфизике за создание лазера.<o:p></o:p></span></p>\n\n<p class=\"MsoNoSpacing\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\nmso-bidi-font-weight:bold\">Вы видите кирпич с результатами воздействия на него\nлазерного луча. На кирпиче надпись: «Если кто придет с мечом, с ним станет то,\nчто стало с кирпичом!»<o:p></o:p></span></p>"
