          "text": "<p class=\"MsoNormal\"><span style=\"font-size: 13px;\">Выносной крупногабаритный музейный экспонат установлен на территории школы в ознаменование 55-й годовщины создания первого экспериментального комплекса противоракетной обороны (ПРО) нашей страны - Системы «А».</span></p><p class=\"MsoNormal\"><span style=\"font-size: 13px;\"><br></span></p><p class=\"MsoNormal\"><span style=\"font-size: 13px;\">Такой противоракетой 04 марта 1961 года впервые в мире была уничтожена головная часть баллистической ракеты.</span></p><p class=\"MsoNormal\"><span style=\"font-size: 13px;\"><br></span></p><p class=\"MsoNormal\"><span style=\"font-size: 13px;\">Таким образом, было опровергнуто утверждение многих советских и зарубежных ученых о принципиальной невозможности поражения ракеты ракетой в космическом пространстве из-за их значительных относительных скоростей</span></p>"
